import React from 'react';
import styled from 'styled-components';
import Logo from '../../Images/Logo/SpinzerLogoGolgenSilver.png';

const FooterDiv=styled.div`
width: 100vw;
height: 30vh;
background-color: #000d1a;

`;

const ImageDiv=styled.div`
width: 300px;
height: 100%;
margin: 0;
`;

const Footer = () => {
    return (
       <FooterDiv>
           <ImageDiv>
           <img src={Logo} style={{height:'20vh',marginTop:'50px'}}/>
           </ImageDiv>
       </FooterDiv>
    )
}

export default Footer
